import React from "react";
import  './Answer.css'



const AnswerList =(props)=>{
    let answerlist=Object.keys(props.answer)
        .map((qAnswer,i)=>(
            <li
            onClick={this.onclick}

            >
                {props.answer[qAnswer]}
            </li>

        ));
    return(
        <div className={"AnswerList"}>
           <ul>
               {answerlist}
           </ul>
        </div>
    );
}

export  default AnswerList;
